//import useState hook to create menu collapse state
import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
//import react pro sidebar components
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap/dist/js/bootstrap.bundle'

import "./sidebar.css";


const Header = () => {
  return (
    <>
		<nav class="menu" tabindex="0">
			<div class="smartphone-menu-trigger"></div>
		<header class="avatar">
				<img src="https://s3.amazonaws.com/uifaces/faces/twitter/kolage/128.jpg" />
			<h2>John D.</h2>
		</header>
			<ul>
			<li tabindex="0" class=""><span>Dashboard</span></li>
			<li tabindex="0" class=""><span>Customers</span></li>
			<li tabindex="0" class=""><span>Users</span></li>
			<li tabindex="0" class=""><span>Settings</span></li>
		</ul>
		</nav>

		<main>
		<div class="helper">
			RESIZE THE WINDOW
				<span>Breakpoints on 900px and 400px</span>
		</div>
		</main>   
    </>
  );
};

export default Header;
